integer             ia, ib
real                ra, rb
doubleprecision     da, db
complex             ma, mb
doublecomplex       na, nb

if(ia .eq. ib) continue
if(ia .ne. ib) continue
if(ia .ge. ib) continue
if(ia .le. ib) continue
if(ia .lt. ib) continue
if(ia .gt. ib) continue

if(ra .eq. rb) continue
if(ra .ne. rb) continue
if(ra .ge. rb) continue
if(ra .le. rb) continue
if(ra .lt. rb) continue
if(ra .gt. rb) continue

if(da .eq. db) continue
if(da .ne. db) continue
if(da .ge. db) continue
if(da .le. db) continue
if(da .lt. db) continue
if(da .gt. db) continue

if(ma .eq. mb) continue
if(ma .ne. mb) continue

if(na .eq. nb) continue
if(na .ne. nb) continue

end
